import React from "react";
import Banner from "./Baneer"; // Assuming Banner component is in the same directory

const HeroSection = () => {
  return (
    <section id="heroSection" className="hero-section">
      <div className="hero-section-content-box">
        <div className="hero-section-content">
          <p className="section-title">Hey, I'm Ajay Kumar Medikonda</p>
          {/* Removed redundant Student title */}
          <Banner /> {/* Render the Banner component */}
          <p className="hero-section-description">
            {/* Removed redundant Developer description */}
          </p>
          <a href="#Contact" className="btn btn-primary">Get In Touch</a>
        </div>
      </div>
      <div className="hero-section-img">
        <img src="./img/hero_img.png" alt="Hero Section" /> {/* Replace with your image path */}
      </div>
    </section>
  )
}

export default HeroSection;
